import Card from '../card/Card';
import { connect } from 'react-redux';
const Favorites = ({myFavorites})=>{

    return(
        <>
        {myFavorites?.map(fav=>{
            return(
                <Card>
                    key={fav.id}
                    id={fav.id}
                    name={fav.name}
                    image={fav.image}
                </Card>
            )})}
        </>
    )
};

const mapStateToProps=(state)=>{
    return{
        myFavorites:state.myFavorites
    }
}

export default Connect(mapStateToProps,null)(Favorites);
